$(document).ready(function() {

    $('[data-toggle="tooltip"]').tooltip();
    $('[data-toggle="popover"]').popover();
    $('[data-toggle="popover_h"]').popover({
        trigger: "hover"
    });

    //Menu Sticky
    var stickyNavTop = $('.menuTopFix').offset().top;
    var stickyNav = function() {
        var scrollTop = $(window).scrollTop();
        if (scrollTop > stickyNavTop) {
            $('.menuTopFix').addClass('sticky');
        } else {
            $('.menuTopFix').removeClass('sticky');
        }
    };
    stickyNav();
    $(window).scroll(function() {
        stickyNav();
    });

    $('body').on('click', function(e) {
        $('[data-toggle="popover"]').each(function() {
            //the 'is' for buttons that trigger popups
            //the 'has' for icons within a button that triggers a popup
            if (!$(this).is(e.target) && $(this).has(e.target).length === 0 && $('.popover').has(e.target).length === 0) {
                $(this).popover('hide');
            }
        });
    });

    window.onload = function() {
     /*   document.addEventListener("contextmenu", function(e) {
            e.preventDefault();
        }, false);*/
        document.addEventListener("keydown", function(e) {
            //document.onkeydown = function(e) {
            // "I" key
            if (e.ctrlKey && e.shiftKey && e.keyCode == 73) {
                disabledEvent(e);
            }
            // "J" key
            if (e.ctrlKey && e.shiftKey && e.keyCode == 74) {
                disabledEvent(e);
            }
            // "S" key + macOS
            if (e.keyCode == 83 && (navigator.platform.match("Mac") ? e.metaKey : e.ctrlKey)) {
                disabledEvent(e);
            }
            // "U" key
            if (e.ctrlKey && e.keyCode == 85) {
                disabledEvent(e);
            }
            // "F12" key
            if (event.keyCode == 123) {
                disabledEvent(e);
            }
        }, false);

        function disabledEvent(e) {
            if (e.stopPropagation) {
                e.stopPropagation();
            } else if (window.event) {
                window.event.cancelBubble = true;
            }
            e.preventDefault();
            return false;
        }
    };

});


function backtop() {
    $("#back-top").hide();
    $(function() {
        $(window).scroll(function() {
            if ($(this).scrollTop() > 100) {
                $('#back-top').fadeIn();
            } else {
                $('#back-top').fadeOut();
            }
        });
        $('#back-top a').click(function() {
            $('body,html').animate({
                scrollTop: 0
            }, 800);
            return false;
        });
    });
}

function goSlide(a, b) {
    var c, upSlide;
    if ($("#" + a).length > 0) {
        c = $("#" + a);
    } else if ($("." + a).length > 0) {
        c = $("." + a);
    } else {
        return false;
    }
    if (b) {
        upSlide = c.offset().top - b;
    } else {
        upSlide = c.offset().top;
    }
    $("html, body").animate({
        scrollTop: upSlide
    }, 'slow', function() {});
    return false;
}

// overlay
function enable_overlay() {
    $("span.global-overlay").remove(); // remove first!
    $('body').append('<span class="global-overlay"></span>');
}

function disable_overlay() {
    $("span.global-overlay").remove();
}

function SayiKontrol(e) {
    olay = document.all ? window.event : e;
    tus = document.all ? olay.keyCode : olay.which;
    if (tus < 48 || tus > 57) {
        if (document.all) {
            olay.returnValue = false;
        } else {
            olay.preventDefault();
        }
    }
}

function HarfKontrol(e) {
    olay = document.all ? window.event : e;
    tus = document.all ? olay.keyCode : olay.which;
    if (tus >= 48 && tus <= 57) {
        if (document.all) {
            olay.returnValue = false;
        } else {
            olay.preventDefault();
        }
    }
}


